import React from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import {Switch} from 'react-router-dom';
import {Route} from 'react-router-dom';
import Contact from './components/Contact';
import './App.css';

function App() {
  return (

    <Router>

    <div className="App">



                  <Switch>

                     <Route path="/Contact">
                        <Contact />
                      </Route>

                  </Switch>




    </div>
  </Router>
  );
}

export default App;
